<script setup>
import { onMounted, onBeforeUnmount } from "vue";
import gsap from "gsap";
import { ScrollTrigger } from "gsap/ScrollTrigger";
gsap.registerPlugin(ScrollTrigger);

let scrollTrigger1, scrollTrigger2;

onMounted(() => {
  const SpringText = gsap.timeline();
  scrollTrigger1 = ScrollTrigger.create({
    animation: SpringText,
    trigger: ".scrollElement",
    start: "2% top",
    end: "6% 100%",
    scrub: 2,
  });
  SpringText.from("#springtext", { opacity: 0, yPercent: 100 });

  const SpringTextoff = gsap.timeline();
  scrollTrigger2 = ScrollTrigger.create({
    animation: SpringTextoff,
    trigger: ".scrollElement",
    start: "22% top",
    end: "30% 100%",
    scrub: 1,
  });
  SpringTextoff.to("#springtext", { opacity: 0, yPercent: 30 });
});

onBeforeUnmount(() => {
  scrollTrigger1.kill();
  scrollTrigger2.kill();
});
</script>

